exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.kanbiqu.com/${bid}/index.html`,{cleaner:html=>cleanCatalogWrapper(html,/class="chapters"[^>]*>/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};